g4ZBYs0-10LFA","isOwnerViewing":false,"shortDescription":"Mejora tus habilidades de dibujo y desbloquea tu creatividad: http://bit.ly/2lwYyX1\n\nAdemás de ser un gran ilustrador, Puño ha dedicado los últimos años a enseñar a dibujar a personas que lo creían imposible. A través de ejercicios sencillos y divertidos es capaz de desengrasar al dibujante más oxidado y desbloquear su creatividad.\n\nEste curso, enfocado a dibujantes de cualquier nivel que encuentran dificultades en cuestiones como la perspectiva, las proporciones, las sombras o el color, es el complemento perfecto a los otros dos cursos que Puño imparte en Domestika: Dibujo para principiantes nivel -1, en el que te daba las pautas para perderle el miedo al papel en blanco, creando un completo cuaderno de artista; e Ilustración original de tu puño y tableta, en el que te enseñaba a iniciarte en mundo de la ilustración digital y la impresión casera a varias tintas.\n\nVer más cursos de Domestika http://bit.ly/CursosDMSTK\n\nAprende a tu ritmo y desde donde quieras, sin horarios ni entregas. Descubre las técnicas de los expertos del sector creativo a través de vídeos de máxima calidad con acceso ilimitado. Interactúa con otros alumnos y el profesor del curso. Comparte y aprende lo que te apasiona.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/s14gj6Ok2iE/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLAyACjve9FA6CGTQz_C44BcsSeIiA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/s14gj6Ok2iE/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLDtiiPISEviKiQLnKFJm4EY_alaFQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/s14gj6Ok2iE/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLCRbGkxMnt3ox0K4Om3Ocp_3CkZjQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/s14gj6Ok2iE/hqdefault.jpg?sqp=-oaymwEcCNACELwBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLBb_bsaN48DME45Am6Cm_8g an ilustrador, Puño ha dedicado los últimos años a enseñar a dibujar a personas que lo creían imposible. A través de ejercicios sencillos y divertidos es capaz de desengrasar al dibujante más oxidado y desbloquear su creatividad.\n\nEste curso, enfocado a dibujantes de cualquier nivel que encuentran dificultades en cuestiones como la perspectiva, las proporciones, las sombras o el color, es el complemento perfecto a los otros dos cursos que Puño imparte en Domestika: Dibujo para principiantes nivel -1, en el que te daba las pautas para perderle el miedo al papel en blanco, creando un completo cuaderno de artista; e Ilustración original de tu puño y tableta, en el que te enseñaba a iniciarte en mundo de la ilustración digital y la impresión casera a varias tintas.\n\nVer más cursos de Domestika http://bit.ly/CursosDMSTK\n\nAprende a tu ritmo y desde donde quieras, sin horarios ni entregas. Descubre las técnicas de los expertos del sector creativo a través de vídeos de máxima calidad con acceso ilimitado. Interactúa con otros alumnos y el profesor del curso. Comparte y aprende lo que te apasiona."},"lengthSeconds":"163","ownerProfileUrl":"http://www.youtube.com/channel/UCKbtk1ZAH5g4ZBYs0-10LFA","externalChannelId":"UCKbtk1ZAH5g4ZBYs0-10LFA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME"
